description:
Comedy Nights with Kapil is an Indian comedy show that airs on Colors TV channel. The show is hosted by comedian Kapil Sharma. The format of the show is mixed, with Sharma acting out skits on stage with supporting characters, while also interacting with members in the audience and permanent guest Navjot Singh Siddhu. It often features celebrity guests, who usually appear to promote their latest films and with whom the actors interact in-character.


The show features other actors such as Sumona Chakravarti, Ali Asgar, Upasana Singh and Naseem Vicky playing various members of Sharma's family.


In today's episode, Kapil gets a call from a goon named, Dilawar, who tells him that he is coming to see his mother-in-law's corpse. He requests every member of his family to act as corpses so that Dilawar doesn't kill him. Also watch, Ram Charan and Priyanka Chopra come in the show to promote their upcoming film Zanjeer. Watch the hilarious episode of Comedy Nights with Kapil for non-stop laughter.

